import React, {Component} from 'react';

class TrackingLogo extends Component {
    constructor(){
        super();
        this.state = {
            clientsLogo: [
                {
                    id: 1,
                    url: '#apple',
                    col: "col-lg-2 col-md-3 col-4",
                    image: 'logo-global.png',
                },
                {
                    id: 2,
                    url: '#',
                    col: "col-lg-2 col-md-3 col-4",
                    image: 'logo-target.png',
                },
                {
                    id: 3,
                    url: '#',
                    col: "col-lg-2 col-md-3 col-4",
                    image: 'logo-miraclon.png',
                },
                {
                    id: 4,
                    url: '#',
                    col: "col-lg-2 col-md-3 col-4",
                    image: 'logo-logixboard.png',
                },
                {
                    id: 5,
                    url: '#',
                    col: "col-lg-2 col-md-3 col-4",
                    image: 'logo-falabella.png',
                },
                {
                    id: 6,
                    url: '#',
                    col: "col-lg-2 col-md-3 col-4",
                    image: 'logo-bolivar.png',
                }
            ]
        }
    }
    render(){
        return(
            <div className="row tracking_software_logo">
                {
                    this.state.clientsLogo.map(item=>(
                        <div className={item.col} key={item.id}>
                            <a href={item.url}><img src={require ("../img/new/" + item.image).default}alt=""/></a>
                        </div>
                    ))
                }
            </div>
        )
    }
}

export default TrackingLogo;
